* {
  // background: antiquewhite;
  ul {
    margin: 0;
  }
  ul.dashed {
    list-style-type: none;
    padding-left: 1rem;
    }
  ul.dashed > li {
    text-indent: -5px;
  }
  ul.dashed > li:before {
    content: "-";
    text-indent: -5px;
  }
}

// home scroll

.scroll-home {
  position: fixed;
  bottom: 800px;
  right: .5rem;
  width: 60px;
  height: 60px;
  background: antiquewhite url('../images/SVGIcons/home-icon.svg');
  border-radius: 50%;
  background-size: 30px;
  background-position: center;
  background-repeat: no-repeat;
  cursor: pointer;
  z-index: 99999;
  visibility: hidden;
  opacity: 0;
  transition: .5s;
}

.scroll-home.active {
  bottom: 40px;
  visibility: visible;
  opacity: 1;
}

// toggle effect

:root {
  --clr-light: antiquewhite;
  --clr-dark: black;
  --clr-primary: antiquewhite;

  --foreground: var(--clr-dark);
  --background: var(--clr-light);

}

.darkmode {
  --clr-light: antiquewhite;
  --clr-dark: black;
  --clr-primary: antiquewhite;

